import React from 'react';

import './Table.scss';

export default props => {
  return (
    <table id="RoundedTable">
    <tr><th>Table header</th><th>Another header cell</th></tr>
    <tr><td>Table cell...</td><td>More data...</td></tr>
    <tr><td>Table cell...</td><td>More data...</td></tr>
    <tr><td>Table cell...</td><td>More data...</td></tr>
    <tr><td>Table cell...</td><td>More data...</td></tr>
  </table>
  );
};
